import React from "react";

function Aluminum() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Aluminum</h1>
      <p>Recycle aluminum cans and foil clean and dry.</p>
      <ul>
        <li>Rinse cans</li>
        <li>Crush if allowed locally</li>
      </ul>
    </div>
  );
}

export default Aluminum;
